件人应于发货前提供相应授权书或认证报告，如未提供导致货物扣关甚至退运而产生的，所有责任和相关费用将由发件人承担。</span><span style="font-family: 微软雅黑; color: rgb(0, 0, 0); font-size: 10pt;"><br></span><span style="font-family: 微软雅黑; color: rgb(0, 0, 0); font-size: 10pt;">8.P.O.BOX,阿拉斯加(AK),夏威夷(HI),波多黎各(PR),关岛,军方地址不收，967**，968**，969**和995**，999**邮编没有服务）。注意亚马逊货也可能产生住宅地址及杂费，如产生账单半年有效实报实销,欲知您所发货物目的地是否属偏远地区请上网查询,我司出货时不另行通知，以帐单产生为准。</span><span style="font-family: 微软雅黑; color: rgb(255, 0, 0); font-size: 10pt;"><o:p></o:p></span></p></td></tr><tr style="height:28.5000pt;"><td width="1572" valign="center" colspan="7" style="width:1179.5000pt;padding:0.0000pt 5.4000pt 0.0000pt 5.4000pt ;border-left:1.0000pt solid rgb(0,0,0);
